import React, { Component } from "react";
import { View,Text,Image, TouchableOpacity } from "react-native";
import Slider from "@react-native-community/slider";



export default class Main extends Component{
    constructor(props) {
        super(props);
        this.state = {
          sliderValue: 0,
        };
      }




    render(){
        return(

            <View style={{
                flexDirection:"row",
                height:"100%"
            }}>
                <View style ={{
                    width:"18%",
                    height:"100%",
                    backgroundColor:"#880606",
                    borderRightWidth:2,
                    borderRightColor:"#ffffff"

                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606"}}>
                        <View style={{height:120,width:280,marginLeft:28,backgroundColor:"#ffffff",shadowRadius:8}}>
                            <Image source={require('./images/MAAN_INSTITUTE_OF_MANAGEMENT_AND_SCIENCE_a-removebg-preview.png')}
                            style={{
                                width:"100%",
                                height:"100%",
                                resizeMode:"contain"
                            }}
                            ></Image>
                            <View style={{flexDirection:"row",marginTop:20}}>
                                <View style={{borderRadius:100,backgroundColor:"white",width:80,height:80}}>
                                    <Image source={require('./images/imagemain.png')}
                                    style={{resizeMode:"contain",width:"100%",height:"100%",borderRadius:100}}
                                    ></Image>

                                </View>
                                <View style={{flexDirection:"column",marginLeft:10,marginTop:10}}>
                                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"bold",alignSelf:"center",color:"#ffffff",fontSize:20}}>Khuwaja Hammad</Text>
                                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"200",color:"#ffffff",fontSize:20}}>12573</Text>
                                </View>
                            </View>
                            <View style={{
                                flexDirection:"row"
                            }}>
                                <View style={{
                                    width:125,
                                    height:80,
                                    backgroundColor:"#ffffff",
                                    borderRadius:8,
                                    borderWidth:1,
                                    borderColor:"#880606",
                                    alignContent:"center",
                                    alignItems:"center",
                                    justifyContent:"center",marginTop:10
                                }}>
                                    <Text style={{fontFamily:"oswald",fontWeight:"bold",fontSize:22}}>3.22</Text>
                                    <Text style={{fontFamily:"oswald",fontWeight:"400",fontSize:14}}>CGPA</Text>
                                </View>
                                <View style={{
                                    width:125,
                                    marginLeft:10,
                                    height:80,
                                    backgroundColor:"#ffffff",
                                    borderRadius:8,
                                    borderWidth:1,
                                    borderColor:"#880606",
                                    alignContent:"center",
                                    alignItems:"center",
                                    justifyContent:"center",marginTop:10
                                }}>
                                    <Text style={{fontFamily:"oswald",fontWeight:"bold",fontSize:22}}>22</Text>
                                    <Text style={{fontFamily:"oswald",fontWeight:"400",fontSize:14}}>Credit hrs Left</Text>
                                </View>
                                
                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#ffffff",
                                borderTopColor:"#ffffff",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{
                                    flexDirection:"row"
                                }}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:3
                                }}
                                ></Image>
                                <Text style={{paddingRight:10, fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#ffffff"}} >Student Info</Text>
                                </TouchableOpacity>


                                



                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#ffffff",
                                borderTopColor:"#ffffff",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{
                                    flexDirection:"row"
                                }}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:3
                                }}
                                ></Image>
                                <Text style={{paddingRight:10, fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#ffffff"}} >Examinations</Text>
                                </TouchableOpacity>


                                



                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#ffffff",
                                borderTopColor:"#ffffff",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{
                                    flexDirection:"row"
                                }}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:3
                                }}
                                ></Image>
                                <Text style={{paddingRight:10, fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#ffffff"}} >Academics</Text>
                                </TouchableOpacity>


                                



                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#ffffff",
                                borderTopColor:"#ffffff",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{
                                    flexDirection:"row"
                                }}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:3
                                }}
                                ></Image>
                                <Text style={{paddingRight:10, fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#ffffff"}} >Accounts</Text>
                                </TouchableOpacity>


                                



                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#ffffff",
                                borderTopColor:"#ffffff",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{
                                    flexDirection:"row"
                                }}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:3
                                }}
                                ></Image>
                                <Text style={{paddingRight:10, fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#ffffff"}} >Attendance</Text>
                                </TouchableOpacity>


                                



                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#ffffff",
                                borderTopColor:"#ffffff",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{
                                    flexDirection:"row"
                                }}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:3
                                }}
                                ></Image>
                                <Text style={{paddingRight:10, fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#ffffff"}} >Finance</Text>
                                </TouchableOpacity>


                                



                            </View>
                        </View>

                    </View>
                </View>

                <View style={{
                    width:"82%",
                    height:"100%",
                    backgroundColor:"#ffffff"
                    }}>
                        <View style={{
                            flexDirection:"column"
                        }}> 

                        

                    
                    <View style={{width:"100%",height:"5.15%",backgroundColor:"#880606",justifyContent:"center",alignContent:"flex-start",alignItems:"flex-start"}}>
                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"600",alignSelf:"center",color:"#ffffff",fontSize:22}}>WWW.EMAAN.EDU.PK</Text>

                     </View>
                     <View style={{
                        flexDirection:"row",
                        width:"100%"
                     }}>
                     <View style={{
                    borderRadius:8,
                    borderWidth:1,
                    borderColor:"#880606",
                    backgroundColor:"#FFFAFA",
                    width:"50%",
                    height:600,
                    marginLeft:20,
                    marginTop:20,
                    flexDirection:"column",
                    
                }}>
                    <Text style={{fontFamily:"oswald",paddingLeft:70,paddingTop:10, fontSize:18,fontWeight:"bold",color:"#880606"}}>MY LATEST UPDATES</Text>
                    <View style={{
                        width:"90%",
                        height:1,
                        backgroundColor:"#880606",
                        alignSelf:"center",marginTop:10
                    }}></View>

                </View>
                <Image source={require('./images/311414484_982480953145688_4434059265801315544_n.jpg')}
                style={{
                    resizeMode:"cover",
                    width:700,
                    height:600,
                    borderRadius:8,
                    marginTop:20
                }}
                
                >

                </Image>
                </View>
                <View style={{
                    borderRadius:8,
                    borderWidth:1,
                    borderColor:"#880606",
                    backgroundColor:"#FFFAFA",
                    width:780,
                    height:350,
                    marginLeft:20,
                    marginTop:20,
                    flexDirection:"column",
                    
                }}>
                    <Text style={{fontFamily:"oswald",paddingLeft:42,paddingTop:10, fontSize:18,fontWeight:"bold",color:"#880606"}}>CURRENT SEMESTER SCHEDULE</Text>
                    <View style={{
                        width:"90%",
                        height:1,
                        backgroundColor:"#880606",
                        alignSelf:"center",marginTop:10
                    }}></View>

                </View>
                

                </View>
                </View>
                
                


            </View>
            
        );
    }

}
